import getArticle from "../utils/contentful.js";

const Home = (props) => {
    //console.log(props)
    return (
        <div>
            {props.article && props.article.map(post => {
                return (
                    <div>
                        <p>{post.fields.title}</p>
                    </div>
                );
            })}
        </div>
    )
}
Home.getInitialProps = async () => {
    const contentfulArticle = getArticle("blogPost");
    const article = contentfulArticle.items;
    console.log(article)

    return {
        article
    };
}


export default Home;
